import React from 'react'
import '../Style.css'
import { NextPages } from '../../components/Components';

const TwoLink = [
    {style: {color: 'blue'}, link: '/InternshipReport/Développement'},
    {style: {color: 'blue'}, link: '/InternshipReport/Conclusion'},
];

const Teams = ({ closeMobileMenu }) => {
    return (
        <div>
            <h1 className='title'>Teams</h1>

            <p>Lors de ce stage j'ai eu la chance de travailler dans deux equipes avec de tres bonnes ambiance ainsi que avec des sujets sens</p>
            <NextPages closeMobileMenu={closeMobileMenu} TwoLink={TwoLink} Status={2}/>
        </div>
    )
}

export default Teams
